    false,nt"url": null,nt"notes": "nDuring the winters of 1965/66 through
    1976/77, NOAA/Great Lakes Environmental Research Laboratory (GLERL) collected weekly
    ice thickness and stratigraphy data at up to 90 stations per year on the Great Lakes.
    Data include station name, latitude, longitude and period of record as well as thickness
    of up to six ice layers, total ice thickness, snow depth (on top of ice), snow condition,
    ice condition, and ice type code. The data are useful for site-specific shoreline
    engineering studies, winter navigation projects and remote sensing ground truth.
    Constraints on the data include the relatively short period of record (eleven seasons
    maximum for any one station). Additionally, the time series may not reflect the
    full winter severity range. Nearshore data may not be valid for nearby locations
    or representative of offshore conditions, and ice type codes (the visual observation
    code) changed in 1974/75. Both old and new code lists are available.n",nt"license_title":
